import "../styles/ProjectDetails.css";

const ProjectDetails = () => {
  return (
    <div className="projectdetails">
      <div className="projectheading">
        <h1>{this.props.heading}</h1>
        <p>{this.props.text}</p>
      </div>
    </div>
  );
};

export default ProjectDetails;
